/** @format */

import React from 'react';

import './table.row.scss';

const TableRow = ({ item }) => {
	return (
		<form>
			<div className='cell'>
				<span>{item.id}</span>
			</div>
			<div className='cell'>
				<input placeholder='Name' value={item.name} />
			</div>
			<div className='cell'>
				<span>{item.price}</span>
			</div>
			<div className='cell'>
				<input type='text' placeholder='Quantity' value={item.quantity} />
			</div>
			<div className='cell'>
				<span>{item.quantity * item.price}</span>
			</div>
			<div className='cell'>
				<span>Edit | Dele</span>
			</div>
		</form>
	);
};
export default TableRow;
